import { View, Text } from "react-native";
import { Entypo } from '@expo/vector-icons'; 
import theme from "../styles/theme";

const Menu = () => {
    return (
        <View>
            <Entypo name="home" size={24} color={theme.fontColor1}/>
            <Text>Workouts</Text>
        </View>
    );
}

export default Menu;
